import Usuario from '../Usuario';
import './style.css'

function ListasUsuarios({usuarios}){
    return(
        <div className='lista-usuario3'>
            {
                usuarios.map(usuario => <Usuario usuario={usuario}/>)
            }
        </div>

    );
}
export default ListasUsuarios;
